deck_description:
I'm not gonna lie, when the Spell "Battle Royal Mode - Joining" was revealed, I was genuinely at a loss on how to use it. The card is casual trash, but I still wanted to think of SOME way to play it well! So after a morning energy drink and some sunny-side up eggs, I had my light bulb moment: I was gonna use it in Trains! I named this particular deck "PAIN TRAIN" after the song "Here Comes The Pain Train" by Jay Harper.

&nbsp;

See, Juggernaut Liebe can attack monsters 1 more time for each Xyz Material it has, which means you can target your opponent's Effect Monster with Battle Royal Mode - Joining, so that it has to battle 3 times before it can be destroyed. Liebe can then attack it at least twice (and even use its other effect to increase its ATK to 6000 beforehand) to OTK the opponent!

&nbsp;

Because Trains is an unga bunga Deck, you want to go second 110% of the time. I also put a bunch of hand traps, 3 Dark Ruler, and Lightning Storm in the Side Deck in case you are facing a stronger, more competitive Deck.

@Ignister deck, made in my stile!

&nbsp;

&nbsp;

Testing Popperup draw power.

&nbsp;

Next deck gonna be S-Force.

&nbsp;

&nbsp;

GLHF

This deck is mainly a going 1st deck but can also go 2nd if needed by using "<a data-name="white aura whale">white aura whale</a><a data-name="white aura whale">" it can get many negates on board and is very resilient.</a>

&nbsp;

&nbsp;

Juat trying to use the Brave Engine to go 2nd and otk with Dual Avatars summoning power, with one of each of the archetype's traps for in case we can't otk, and for value, and a lot of the side deck is for if we have to go first, or simply want to try to grind them out. All opinions and criticisms will be welcome and appreciated!

&nbsp;

The Brave token equip spells are actually the 3rd Aqua and Rite, which I presume are limited in ocg as this won't let me add 3rd copies of them.
